import PageItem from "./PageItem";
function PageList() {
  return (
    <ul className="pagination">
      <PageItem>Previous</PageItem>
      <PageItem>1</PageItem>
      <PageItem>2</PageItem>
      <PageItem>3</PageItem>
      <PageItem>Next</PageItem>
    </ul>
  );
}
export default PageList;
